import React, {useContext} from 'react';
import { Link } from 'react-router-dom';
import { AuthContext } from '../../auth/AuthContext';
import Button from '@material-ui/core/Button';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import MailIcon from '@material-ui/icons/Mail';
import ExitToAppIcon from '@material-ui/icons/ExitToApp';
import './NavLinks.css'
import { List } from '@material-ui/core';
import LockOpenIcon from '@material-ui/icons/LockOpen';





export default function NavLinks({onLogOut}) {

    const {authenticated } = useContext(AuthContext);

    return (
        <div>
            <List>
              {!authenticated &&
              <ListItem >
                <ListItemIcon></ListItemIcon>
                <ListItemText />Sign up
              </ListItem>}


           {!authenticated ?
            <Link to="/login"><Button className="headerLink" >Login</Button></Link>:
            <Link to="/login"><Button onClick={onLogOut} className="headerLink" >Logout</Button></Link> }
           {authenticated &&
            <Link to="/training-tab"><Button className="headerLink" >Training</Button></Link> }
            </List>
            <List>

          </List>
        </div>
    )
}
